import React from 'react'

class Columns extends React.Component {
  constructor (props) {
    super(props)
    this.state = {
      'showLoading': true,
      'showError': false
    }
    this.elements = []
  }
  componentDidMount () {
    fetch(`http://46.188.118.134:8082/navigations?type=${this.props.type}`)

      .then(response => response.json())
      .then(response => {
        response
          .sort((a, b) => a.createdAt < b.createdAt ? 1 : -1)
          .forEach(article => {
            console.log(article)
            this.elements.push(
              <li><a href='#'>{article.pop().name_ru}</a></li>
            )
          })
        this.setState({
          'showLoading': false,
          'showError': false
        })
      })
      .catch(error => {
        console.error(error)
        this.setState({
          'showLoading': false,
          'showError': true
        })
      })
  }
  render () {
    return (
      <footer class='footer'>
        <div class='container'>
          <div class='columns'>
            <div class='column is-3 is-offset-2'>
              <ul>
              {this.elements}
              {this.elements}
              {this.elements}

              </ul>
            </div>
            <div class='column is-3'>
              <ul>
              {this.elements}
              {this.elements}
              {this.elements}

              </ul>
            </div>
            <div class='column is-4'>

              <ul>
              {this.elements}
              {this.elements}
              </ul>
            </div>
          </div>

        </div>

      </footer>
    )
  }
}
export default Columns
